('86b121dd-cb5f-4368-a4e0-b606c9e29f10', 'a7da3904-505d-47cb-8333-6d2bca7b0480', '1470a406-3761-4404-9531-520164e56650', '70603', 'Operational', 'Needs Replacement', 'GoodCondition', '89', 'Quiddam inter dolorem et voluptatem; illud enim ipsum, quod quibusdam medium videretur, cum omni dolore careret, non modo quid nobis probaretur, sed etiam quid a singulis philosophiae disciplinis diceretur, persecuti sumus. Ut autem a facillimis ordiamur, prima veniat in medium Epicuri ratio, quae plerisque notissima est. Quam a.', '2024-09-26', '2024-12-20 03:53:45', '1'),
